import React, { Component } from 'react';
import Input from './Input';
import ItemList from './ItemList';

class ToDoList extends Component {
    render() {
        return (
            <div>
                <h1>Welcome to my Todo List!</h1>
                <div>
                    <Input />
                    <ItemList />
                </div>
            </div>
        );
    }
}

export default ToDoList;
